import { render } from "@testing-library/react";
import React from "react";
import { Route, withRouter } from 'react-router';
import CollectionsOverview from '../../Components/CollectionsOverview/CollectionsOverview.component';
import CollectionsPage from '../Collection/CollectionsPage.component';
import ItemPage from '../Item/ItemPage.component';

const ShoppingComponents = ({ match, isFetching}) => {
    render(
        <div>
            <Route exact path={`${match.path}`} render = { (props) => <CollectionsOverviewSpinner  isLoading={isFetching} {...props} />}/>
            <Route exact  path = {`${match.path}/:collectionId`}  render = { (props) => <CollectionsPageSpinner  isLoading={isFetching} {...props} />}/>
            <Route  path = {`${match.path}/:collectionId/:itemId`} render={ (props) => <ItemPageSpinner isLoading={isFetching} {...props}/>}/> 
        </div>
    );
}

export default withRouter(ShoppingComponents);
